import React from 'react'

const Menu = () => {
  return (

      <div className="menu">
        <h1 id="logo">ERIN GREEN</h1>
        <ul id="nav">
          <li><a href="#about">ABOUT</a></li>
          <li><a href="#projectContainer">PORTFOLIO</a></li>
        </ul>
      </div>
  );
};

export default Menu;
